package learn.mt.pspmard.ajcp.conchashmap.model;import java.util.Objects;public class Actor {    private final String lastName;    private final String firstName;        public Actor(String lastName, String firstName) {        this.lastName = lastName;        this.firstName = firstName;    }    @Override    public int hashCode() {        int hash = 7;        hash = 67 * hash + Objects.hashCode(lastName);        hash = 67 * hash + Objects.hashCode(firstName);        return hash;    }    @Override    public boolean equals(Object obj) {        if (obj == null) {            return false;        }        if (getClass() != obj.getClass()) {            return false;        }        final Actor other = (Actor) obj;        if (!Objects.equals(lastName, other.lastName)) {            return false;        }        return Objects.equals(firstName, other.firstName);    }    @Override    public String toString() {        return "Actor{" + "lastName=" + lastName + ", firstName=" + firstName + '}';    }}